import React from 'react';

const schoolLink = (props) => {
    return (
        <div className="row">
            <div className="col-md-2">
                <h5>School Link:</h5>
            </div>
            <div className="col-md-10">
                <input
                    className="form-control"
                    type="text"
                    onChange={props.change}
                    value={props.name}
                    name="schoolLink"
                />
            </div>
        </div>
    )
}

export default schoolLink;
